<template>
  <div class="map-container background">
    <div class="map"></div>
    <template v-for="pin in rows" :key="pin.id">
      <div :style="styleForPin(pin)" class="pin" :title="pin.firstname + ' ' + pin.lastname" @click="selectPin(pin.id)"></div>
    </template>
    <button v-if="higlighted" id="reset-highlighting" @click="resetPinSelection">Reset Selection</button>
  </div>
</template>

<script>

  /* eslint-disable max-len */

  import ColorsMixin from '@/mixins/Colors.mixin';

  export default {
    name: 'WorldMap',
    props: {
      rows: Array,
    },
    mixins: [ColorsMixin()],
    emits: ['selectRow', 'resetRow'],
    data() {
      return {
        mapWidth: 800,
        mapHeight: 412,
        higlighted: false,
        // calibration: [
        //   {contact: {location: {lon: -180, lat: -90}}},
        //   {contact: {location: {lon: 0, lat: -90}}},
        //   {contact: {location: {lon: 180, lat: -90}}},
        //   {contact: {location: {lon: -180, lat: 0}}},
        //   {contact: {location: {lon: 0, lat: 0}}},
        //   {contact: {location: {lon: 180, lat: 0}}},
        //   {contact: {location: {lon: -180, lat: 90}}},
        //   {contact: {location: {lon: 0, lat: 90}}},
        //   {contact: {location: {lon: 180, lat: 90}}},
        // ],
      };
    },
    computed: {
      datasetsNumber() {
        return this.rows.length;
      },
    },
    methods: {
      // Generate the style object for positioning each pin on the map
      styleForPin(pin) {
        const left = ((pin.contact.location.lon + 180) / 360 * this.mapWidth );
        const top = this.mapHeight - ((pin.contact.location.lat + 90) / 180 * this.mapHeight);
        return {
          'left': left + 'px',
          'top': top + 'px',
        };
      },
      // Highlight a pin
      selectPin(id) {
        this.higlighted = true;
        const row = this.rows.find((r)=>r.id === id);
        this.$emit('selectRow', row);
      },
      // Reset highlighting
      resetPinSelection() {
        this.higlighted = false;
        this.$emit('resetRow');
      },
    },
    mounted() {
      document.documentElement.style.setProperty('--map-width', this.mapWidth + 'px');
      document.documentElement.style.setProperty('--map-height', this.mapHeight + 'px');
    },
  };
</script>

<style scoped>
  .map-container {
    margin: 5px 10px;
    width: var(--map-width);
    height: var(--map-height);
    position: relative;
    display: inline-block;
    float:right;
    background-size: 100% 100%;
  }

  @media (max-width: 1590px) {
    .map-container{
      float:left;
    }
  }

  .pin {
    position:absolute;
    height: 6px;
    width: 6px;
    margin-top:-5px;
    margin-left:-5px;
    background-color: var(--color-1);
    border-radius: 6px;
    border:2px solid lightgray;
    cursor:pointer;
    transition: 0.3s all;
  }

  .pin:hover {
    height: 12px;
    width: 12px;
    margin-top:-8px;
    margin-left:-8px;
    background-color: var(--color-2);
    border-radius: 12px;
    border:2px solid lightgray;
    z-index:1;
  }

  #reset-highlighting {
    font-size: 20px;
    margin-left:10px;
    position:absolute;
    bottom: 0;
    right: 0;
  }

  .background{
